description:
[MySistersHotFriend] Denice K (18027 / 05.20.2014)

Joey Ray doesn't mind renting his guest house to his little sister and her friend, Denice K. if they would only stop raiding his fridge and picking all the fruit from his trees. Joey jokes about picking the fruit naked to Denice and she wastes no time heading for his twig &amp; berries!


